#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  http_parser parser;
  http_parser_init(&parser, HTTP_BOTH);

  // Call http_should_keep_alive
  http_should_keep_alive(&parser);

  return 0;
}

